import PostItem from './PostItem';
import {render,screen} from '@testing-library/react';
import { BrowserRouter } from "react-router-dom";
import { Provider } from "react-redux";
import store from '../../redux/store';
import {findData} from '../../utilities/utils';
describe('PostItem Component',()=>{
    const categories=[
        {"id":1,
    name:"programming"},
    {"id":2,
    name:"technology"}
    ]
    const user=[
        {
            "id": 1,
            "firstName": "Navneet",
            "lastName": "Kaur",
            "userName": "nav11",
            "email": "navneet@gmail.com",
            "password": "Home@216",
            "about": "I am a Software Engineer"
          }

    ]
    const post=   {
        "title": "C++ Tips of the Week",
        "categoryId": "1",
        "featureImage": "data:image/jpeg;base64,",
        "content": "<h2>Benefits</h2><p>Writing a non-member in an unnamed namespace has benefits both by making functions internal to a&nbsp;<span style=\"color: rgb(37, 47, 105);\">.cc</span>&nbsp;file (moving them out of header files) as well as by making them non-members (moving them out of classes).</p><p>Benefits over functions declared in a header file include:</p><ul><li>Making it easy for a reader to look up the definition (since it’s in the same file as usage and above the first usage).</li><li>Placing the documentation, declaration, and definition in a single location (versus two locations for functions which are declared in a header file).</li><li>Isolating it from other source files, making it easier to refactor.</li><li>Removing the need to worry about&nbsp;<a href=\"https://abseil.io/tips/109\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(63, 81, 181); background-color: transparent;\">meaningful const</a>&nbsp;as there is no separate declaration.</li><li>Keeping them in the same place as other implementation helpers for a library, such as convenience aliases and local types. See&nbsp;<a href=\"https://abseil.io/tips/[Tip%20#119]\\(/tips/119\\)\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(63, 81, 181); background-color: transparent;\">Tip of the Week #119: Using-declarations and Namespace Aliases</a>.</li><li>Providing side benefits, such as allowing a type to also be moved to an unnamed namespace (if it is only referenced in a single source file).</li></ul><h2><strong>Introduction</strong></h2><p>Object-Oriented programming uses objects in programming which are entities holding some characteristics and behavior. The aim of OOPs is to put together both the data and the function so that the data can be accessed by that function only.</p><p><img src=\"https://www.codingninjas.com/blog/wp-content/uploads/2020/07/p.png\"></p>",
        "shortContent": "Background: About five years ago, within Google we started publishing a series of C++ tips, about once a week, that became known as the “C++ Tips of the Week” (TotW). ",
        "userId": 1,
        "creationDate": "2022-11-25T09:53:16.178Z",
        "readingTime": "2 mins read",
        "clapsCount": [],
        "fileName": "c++.jpg",
        "id": 1
      }
    test('renders postItem image',()=>{
render( <Provider store={store}><BrowserRouter><PostItem categories={categories} user={user} post={post}/></BrowserRouter></Provider>);

 const imgItem1=screen.getByAltText(/user display/i);
 const imgItem2=screen.getByAltText(/blog post feature data/i);
 expect(imgItem1).toBeInTheDocument();
 expect(imgItem2).toBeInTheDocument();
       
    });
    test('renders postItem heading',()=>{
        render( <Provider store={store}><BrowserRouter><PostItem categories={categories} user={user} post={post}/></BrowserRouter></Provider>);
        
         const title=screen.getByRole('heading',{name:`${post.title}`});
         expect(title).toBeInTheDocument();
               
            });
    test('renders postItem category ',()=>{
       render( <Provider store={store}><BrowserRouter><PostItem categories={categories} user={user} post={post}/></BrowserRouter></Provider>);
       const res=findData(+post?.categoryId,categories)
       console.log(res)
       const catElement=screen.getByText(`${res?.name}`,{exact:false});
         expect(catElement).toBeInTheDocument();
        
           });
   
})